inline int read()
{
	int x=0,f=1;char ch=getchar();
	while (ch<'0'||ch>'9'){if (ch=='-') f=-1;ch=getchar();}
	while (ch>='0'&&ch<='9'){x=x*10+ch-48;ch=getchar();}
	return x*f;
}

inline int finda(int num)
{
	if(num<=1000)
	{
		for(int i=1;;++i)
		{
			if(number[i]>=num)
				return i;
		}
	}
	
	if(num<=8500)
	{
		for(int i=30;i<=100;++i)
		{
			if(number[i]>=num)
				return i+1;
		}
	}
	
	if(num>8500)
	{
		for(int i=100;;++i)
		{
			if(number[i]>=num)
				return i;
		}
	}
}

inline int findb(int num)
{
	if(num<=1000)
	{
		for(int i=40;i>=1;--i)
		{
			if(number[i]<=num)
				return i+1;
		}
	}
	
	if(num<=8500)
	{
		for(int i=100;i>=30;--i)
		{
			if(number[i]<=num)
				return i+1;
		}
	}
	
	if(num>8500)
	{
		for(int i=100;;++i)
		{
			if(number[i]>=num)
				return i;
		}
	}
}

